import React, { useState } from 'react';
import axios from 'axios';
import './Profile.css';

const Profile = ({ user }) => {
  // Get user data from localStorage
  const userData = JSON.parse(localStorage.getItem('user')) || {};
  const [profilePic, setProfilePic] = useState(userData.profilePicture || "https://via.placeholder.com/150");
  const [uploading, setUploading] = useState(false);

  const handleProfilePicChange = async (e) => {
    const file = e.target.files[0];
    if (!file) return;

    setUploading(true);

    // Convert to base64
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = async () => {
      try {
        const base64Image = reader.result;

        // Send to server
        const token = localStorage.getItem('token');
        const config = {
          headers: {
            'Content-Type': 'application/json',
            'x-auth-token': token
          }
        };

        const res = await axios.put('http://localhost:5000/api/users/profile-picture', 
          { profilePicture: base64Image }, 
          config
        );

        // Update local storage with updated user data
        const updatedUser = {...userData, profilePicture: base64Image};
        localStorage.setItem('user', JSON.stringify(updatedUser));

        // Update state
        setProfilePic(base64Image);
        setUploading(false);
      } catch (err) {
        console.error('Error uploading profile picture:', err);
        setUploading(false);
      }
    };
  };

  return (
    <div className="container">
      <h1 className="page-title">My Profile</h1>

      <div className="card">
        <div className="profile-header">
          <div className="profile-pic-container">
            <img 
              src={profilePic} 
              alt="Profile" 
              className="profile-pic"
            />
            <div className="profile-pic-overlay">
              <label htmlFor="profile-pic-upload" className="upload-btn">
                {uploading ? 'Uploading...' : 'Change'}
              </label>
              <input 
                type="file" 
                id="profile-pic-upload" 
                accept="image/*" 
                onChange={handleProfilePicChange} 
                style={{ display: 'none' }}
              />
            </div>
          </div>

          <div className="profile-info">
            <h2>{userData.name || 'User'}</h2>
            <p>{userData.email || 'user@example.com'}</p>
          </div>
        </div>

        <div className="profile-stats">
          <div className="stat-card">
            <h3>BMR</h3>
            <div className="stat-value">{userData.bmr || 0}</div>
            <p>Daily calorie needs</p>
          </div>

          <div className="stat-card">
            <h3>Calories Burned</h3>
            <div className="stat-value">{userData.totalCaloriesBurned || 0}</div>
            <p>Total from exercises</p>
          </div>

          <div className="stat-card">
            <h3>Workouts</h3>
            <div className="stat-value">0</div>
            <p>Completed sessions</p>
          </div>
        </div>

        <div className="profile-details">
          <h3>Personal Information</h3>

          <div className="detail-row">
            <div className="detail-label">Name</div>
            <div className="detail-value">{userData.name || 'User'}</div>
          </div>

          <div className="detail-row">
            <div className="detail-label">Email</div>
            <div className="detail-value">{userData.email || 'user@example.com'}</div>
          </div>

          <div className="detail-row">
            <div className="detail-label">Member Since</div>
            <div className="detail-value">October 2025</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
